import React from "react";

import Random from "./components/Random";
import Tag from "./components/Tag";

import "./App.css";

const App = () => (
  <>
    <header>
      <div className="title">
        <p>Kelompok 15</p>
      </div>
    </header>
    <div>
      <div className="main-container">
        <Random />
        <Tag />
      </div>
    </div>
  </>
);

export default App;
